{'passage': 'Under the first Jefferson administration, Monroe was dispatched to France to assist Robert R. Livingston negotiate the Louisiana Purchase. Monroe was then appointed Minister to the Court of St. James (Britain) from 1803 to 1807. In 1806 he negotiated a treaty with Britain to replace the Jay Treaty of 1794, but Jefferson rejected it as unsatisfactory, as the treaty contained no ban on the British practice of impressment of American sailors. As a result, the two nations moved closer toward the War of 1812.', 'id': 2511}
---
{'passage': 'James Monroe (April 28, 1758 â\x80\x93 July 4, 1831) was the fifth President of the United States (1817-1825). His administration was marked by the acquisition of Florida (1819); the Missouri Compromise (1820), in which Missouri was declared a slave state; and the profession of the Monroe Doctrine (1823), declaring U.S. opposition to European interference in the Americas.', 'id': 2506}
---
{'passage': "Monroe returned to the Virginia House of Delegates and was elected to another term as governor of Virginia in 1811, but he resigned a few months into the term. He then served as Secretary of State from 1811 to 1814.  When he was appointed to Secretary of War in 1814, he stayed on as the Secretary of State ad interim.  At the war's end in 1815, he was again commissioned as the permanent Secretary of State, and left his position as Secretary of War.  Thus from October 1, 1814 to February 28, 1815, Monroe effectively held the two cabinet posts.  Monroe stayed on as Secretary of State until the end of the James Madison Presidency, and the following day Monroe began his term as the new President of the United States.", 'id': 2512}
---
{'passage': 'Monroe was elected to the Virginia House of Delegates in 1782 and served in the Continental Congress from 1783 to 1786. As a youthful politician, he joined the anti-Federalists in the Virginia Convention which ratified the Constitution, and in 1790, was elected United States Senator.', 'id': 2508}
---
{'passage': 'The Presidentâ\x80\x99s parents, father Spence Monroe (ca. 1727 1774), a woodworker and tobacco farmer, and mother Elizabeth Jones Monroe had significant land holdings but little money. Like his parents, he was a slaveholder. Born in Westmoreland County, Virginia, Monroe went to school at Campbelltown Academy and then the College of William and Mary, both in Virginia.  After graduating from William and Mary in 1776, Monroe fought in the Continental Army, serving with distinction at the Battle of Trenton, where he was shot in his left shoulder. He is depicted holding the flag in the famous painting of Washington Crossing the Delaware. Following his military service, he practiced law in Fredericksburg, Virginia. James Monroe married Elizabeth Kortright on February 16, 1786 at the Trinity Church in New York.', 'id': 2507}

{'passage': 'Current theories propose that the gray wolf first evolved in Eurasia during the early Pleistocene. The rate of changes observed in DNA sequence date the South-East Asiatic lineage to about 800,000 years, as opposed to the American and European lineages which stretch back only 150,000.    The gray wolf then migrated into North America from the Old World, probably via the Bering land bridge (that once joined Alaska and Siberia), around 400,000 years ago.  The gray wolf then coexisted with the Dire Wolf (Canis dirus), a Canid species that was larger and heavier than the gray wolf and appeared in South America over 700,000 years ago and whose origin is still speculated. The Dire Wolf ranged from southern Canada to South America until about 8,000 years ago when climate changes are thought to have caused it to become extinct. After that the gray wolf is thought to have become the prime canine predator in North America.', 'id': 1096}
---
{'passage': 'Though once abundant over much of North America and Eurasia, the gray wolf inhabits a very small portion of its former range because of widespread destruction of its habitat; in some regions it is endangered or threatened. Considered as a whole, however, the gray wolf is regarded as of least concern for extinction according to the International Union for the Conservation of Nature and Natural Resources. Wolves are still hunted in many areas for sport or as perceived threats to livestock. Kazakhstan is currently thought to have the largest wolf population of any nation; it has as many as 90,000, versus some 60,000 for Canada.', 'id': 1022}
---
{'passage': 'The gray wolf (Canis lupus), also known as the timber wolf or, simply, wolf, is a mammal of the order Carnivora. The gray wolf is the largest member of the family Canidae and also the most well known of wolves. Its shoulder height ranges from 0.6 to 0.9 meters (26â\x80\x9336 inches) and its weight typically varies between 32 and 62 kilograms (70â\x80\x93135 pounds). As evidenced by studies of DNA sequencing and genetic drift the gray wolf shares a common ancestry with the domestic dog (Canis lupus familiaris).', 'id': 1021}
---
{'passage': 'At one point, up to 50 gray wolf subspecies were recognized. Though no true consensus has been reached, this list can be condensed to 13â\x80\x9315 general extant subspecies. Modern classifications take into account the DNA, anatomy, distribution, and migration of various wolf colonies.', 'id': 1097}
---
{'passage': 'Traditionally humans held a distasteful view of wolves, a creature they feared. It was also often accentuated in European folklore beginning in the Christian era. Settlers brought this view with them as they settled North America. The gray wolf, once found in every ecosystem across the Northern Hemisphere, was one of the first species to be culled by settlers. As technology made the killing of wolves and predators easier, humans began to overhunt wolves and cause their numbers to dwindle significantly.', 'id': 1108}

{'passage': 'Non-official languages are important in Canada, with 5,202,245 people listing one as a first language.  Some significant non-official first languages include Chinese (853,745 first-language speakers), Italian (469,485), German (438,080), and Punjabi (271,220).', 'id': 2361}
---
{'passage': 'The national language of Singapore is Malay for historical reasons, and it is used in the national anthem, "Majulah Singapura". The official languages are English, Mandarin, Malay and Tamil. English has been promoted as the country\'s language of administration since independence. The English used is primarily based on British English, with some American English influences.  The use of English became widespread in Singapore after it was implemented as a first language medium in the education system, and English is the most common language in Singaporean literature.  Public signs and official publications are in English, although there are translated versions in other official languages. However, the majority of the population speak a localised hybrid form of English known as Singlish ("Singapore English"), which has many creole-like characteristics, incorporating vocabulary and grammar from Standard English, various Chinese dialects, Malay and Indian languages. The government has consistently tried to discourage the use of Singlish in its "Speak Good English" campaigns.', 'id': 2773}
---
{'passage': "Canada's two official languages are  English and French. Official Bilingualism in Canada is law, defined in the Canadian Charter of Rights and Freedoms, the Official Languages Act, and Official Language Regulations; it is applied by the Commissioner of Official Languages. English and French have equal status in federal courts, Parliament, and in all federal institutions. The public has the right, where there is sufficient demand, to receive federal government services in either English or French, and official language minorities are guaranteed their own schools in all provinces and territories.", 'id': 2358}
---
{'passage': "Although 85% of French-speaking Canadians live in Quebec, there are substantial Francophone populations in Ontario, Alberta and southern Manitoba, with an Acadian population in the northern and southeastern parts of New Brunswick constituting 35% of that province's population as well as concentrations in Southwestern Nova Scotia and on Cape Breton Island. Ontario has the largest French-speaking population outside Quebec. The Charter of the French Language in Quebec makes French the official language in Quebec, and New Brunswick is the only province to have a statement of official bilingualism in the constitution.    Other provinces   have no official language(s) as such, but French is used as a language of instruction, in courts, and other government services in addition to English. Manitoba, Ontario and Quebec allow for both English and French to be spoken in the provincial legislatures, and laws are enacted in both languages. In Ontario, French has some legal status but is not fully co-official. Several aboriginal languages have official status in Northwest Territories. Inuktitut is the majority language in Nunavut, and one of three official languages in the territory.", 'id': 2360}
---
{'passage': 'Singapore has a high literacy rate   . English is the first language learned by half the children by the time they reach preschool age and is the primary medium of instruction in primary school; however mother tongues are taught in the respective languages. English is the language of instruction for mathematics and the natural sciences. Special Assistance Plan schools may teach in another language to encourage more vibrant use of mother tongues.  Some schools also integrate language subjects with mathematics and the sciences, using both English and a second language.', 'id': 2765}

{'passage': 'Females (cows) reach sexual maturity at around 9â\x80\x9312 years of age and become pregnant for the first time, on average, around age 13. They can reproduce until ages 55â\x80\x9360. Females give birth at intervals of about 5 years. Their gestation (pregnancy) period lasts about 22 months (630â\x80\x93660 days), the longest gestation period of any mammal, after which typically one calf is born. Twins are rare. Labour ranges in length from 5 minutes to 60 hours. The average length of labour is 11 hours. At birth, calves weigh around 90â\x80\x93115 kg (200â\x80\x93250 lb), and they gain 1 kg (2â\x80\x932.5 lb) a day. In the wild, the mother is accompanied by other adult females (aunts), who protect the young, and baby elephants are raised and nurtured by the whole family group, practically from the moment of birth.', 'id': 1251}
---
{'passage': "Unlike most mammals, female elephants have a single pair of mammary glands located just behind the front legs. When born, a calf is about 90 centimeters (3 feet) high, just tall enough to reach its mother's nipples. A calf suckles with its mouth, not its trunk, which has no muscle tone. To clear the way to its mouth so it can suckle, the calf will flop its trunk onto its forehead. A newborn calf suckles for only a few minutes at a time but many times per day, consuming up to 11 litres (3 U.S. gallons) of milk in a single day. A calf may nurse for up to 2 years or more. Complete weaning depends on the disposition of the mother, the amount of available milk, and the arrival of another calf.", 'id': 1254}
---
{'passage': "Elephants are mammals, and the largest land animals alive today.    The elephant's gestation period is 22 months, the longest of any land animal. At birth it is common for an elephant calf to weigh 120 kilograms (265 lb).  An elephant may live as long as 70 years, sometimes longer. The largest elephant ever recorded was shot in Angola in 1956. This male weighed about 12,000 kg (26,400 lb),    with a shoulder height of 4.2 m (13.8 ft), a metre (3 ft 4 in) taller than the average male African elephant.    The smallest elephants, about the size of a calf or a large pig, were a prehistoric species that lived on the island of Crete during the Pleistocene epoch. Bate, D.M.A. 1907. On Elephant Remains from Crete, with Description of Elephas creticus sp.n. Proc. zool. Soc. London: 238-250.", 'id': 1177}
---
{'passage': "Elephant social life revolves around breeding and raising of the calves. A female will usually be ready to breed around the age of thirteen, at which time she will seek out the most attractive male to mate with.  Females are generally attracted to bigger, stronger, and, most importantly, older males. Such a reproductive strategy tends to increase their offspring's chances of survival.", 'id': 1256}
---
{'passage': 'After a twenty-two-month pregnancy, the mother will give birth to a calf that will weigh about 113 kg (250 lb) and stand over 76 cm (2.5 ft) tall. Elephants have a very long childhood. They are born with fewer survival instincts than many other animals. Instead, they must rely on their elders to teach them the things they need to know. Today, however, the pressures humans have put on the wild elephant populations, from poaching to habitat destruction, mean that the elderly often die at a younger age, leaving fewer teachers for the young.', 'id': 1257}

{'passage': 'Adult ducks are fast fliers, but may be caught on the water by large aquatic predators. This can occasionally include fish such as the muskie in North America or the pike in Europe. In flight, ducks are safe from all but a few predators such as humans and the Peregrine Falcon, which regularly uses its speed and strength to catch ducks.', 'id': 3176}
---
{'passage': 'Most ducks have a wide flat beak adapted for dredging. They exploit a variety of food sources such as grasses, aquatic plants, fish, insects, small amphibians  Photo of a duck eating a frog , worms, and small molluscs.', 'id': 3164}
---
{'passage': 'Diving ducks and sea ducks forage deep underwater. To be able to submerge more easily, the diving ducks are heavier than dabbling ducks, and therefore have more difficulty taking off to fly.', 'id': 3168}
---
{'passage': 'Duck is the common name for a number of species in the Anatidae family of birds. The ducks are divided between several subfamilies listed in full in the Anatidae article. Ducks are mostly aquatic birds, mostly smaller than their relatives the swans and geese, and may be found in both fresh water and sea water.', 'id': 3163}
---
{'passage': 'Despite widespread misconceptions, most ducks other than female Mallards and domestic ducks do not "quack"; for example, the scaup makes a noise like "scaup", which its name came from.', 'id': 3184}

{'passage': 'Oxygen is obtained via a tracheal system. Air enters a series of tubes along the body through openings called spiracles, and is then taken into increasingly finer fibres. Pumping movements of the body force the air through the system.', 'id': 2391}
---
{'passage': 'Avogadro developed this hypothesis after Joseph Louis Gay-Lussac had published in 1808 his law on volumes (and combining gases). The greatest difficulty Avogadro had to resolve was the huge confusion at that time regarding atoms and molecules   one of the most important contributions of Avogadro\'s work was clearly distinguishing one from the other, admitting that simple particles too could be composed of molecules, and that these are composed of atoms. For instance, John Dalton did not consider this possibility. Avogadro did not actually use the word "atom" as the words "atom" and "molecule" were used almost without difference. He considered that there were three kinds of "molecules," including an "elementary molecule" (our "atom"). Also, a keener attention was given to the definition of mass, as distinguished from weight.', 'id': 741}
---
{'passage': 'The trunk is also used for drinking. Elephants suck water up into the trunk (up to fifteen quarts or fourteen litres at a time) and then blow it into their mouth. Elephants also inhale water to spray on their body during bathing. On top of this watery coating, the animal will then spray dirt and mud, which act as a protective sunscreen. When swimming, the trunk makes an excellent snorkel.', 'id': 1208}
---
{'passage': 'Methane In Agriculture. 15 August  2004. Retrieved 28 August 2007.', 'id': 1744}
---
{'passage': "Avogadro's Law implies that the relationship occurring between the weights of same volumes of different gases (at the same temperature and pressure) corresponds to the relationship between respective molecular weights. Hence, relative molecular masses can be calculated from the masses of gas samples.", 'id': 740}

{'passage': 'Church and state are officially separated since approximately 1916. Most Uruguayans adhere to the Roman Catholic faith (62%), with smaller Protestant (4%) and Jewish (3%), as well as a large nonprofessing group (31%).', 'id': 52}
---
{'passage': 'Although the majority of Uruguayans do not actively practice a religion, they are nominally church members in the Catholic, Protestant and Jewish communities. It is widely considered the most secular nation in Latin America.', 'id': 53}
---
{'passage': "Uruguay's oldest church is in San Carlos, Maldonado.", 'id': 51}
---
{'passage': 'Uruguay (official full name in  ; pron.  , Eastern Republic of  Uruguay) is a country located in the southeastern part of South America.  It is home to 3.3 million people, of which 1.7 million live in the capital Montevideo and its metropolitan area.', 'id': 0}
---
{'passage': 'Montevideo was founded by the Spanish in the early 18th century as a military stronghold. Uruguay won its independence in 1828 following a three-way struggle between Spain, Argentina and Brazil. It is a constitutional democracy, where the president fulfills the roles of both head of state and head of government', 'id': 2}

{'passage': 'Now came a long struggle to produce a full-scale engine.  This required more capital, some of which came from Black.  More substantial backing came from John Roebuck, the founder of the celebrated Carron Iron Works, near Falkirk, with whom he now formed a partnership.  But the principal difficulty was in machining the piston and cylinder.  Iron workers of the day were more like blacksmiths than machinists, so the results left much to be desired.  Much capital was spent in pursuing the ground-breaking patent, which in those days required an act of parliament.  Strapped for resources, Watt was forced to take up employment as a surveyor for eight years.  Roebuck went bankrupt, and Matthew Boulton, who owned the Soho foundry works near Birmingham, acquired his patent rights.  Watt and Boulton formed a hugely successful partnership (Boulton & Watt), which lasted for the next twenty-five years.', 'id': 1955}
---
{'passage': 'Watt finally had access to some of the best iron workers in the world. The difficulty of the manufacture of a large cylinder with a tightly fitting piston was solved by John Wilkinson who had developed precision boring techniques for cannon making at Bersham, near Wrexham, North Wales. Finally, in 1776, the first engines were installed and working in commercial enterprises. These first engines were used for pumps and produced only reciprocating motion.  Orders began to pour in and for the next five years Watt was very busy installing more engines, mostly in Cornwall for pumping water out of mines.', 'id': 1956}
---
{'passage': 'In 1794 the partners established Boulton and Watt to exclusively manufacture steam engines, and this became a large enterprise.  By 1824 it had produced 1164 steam engines having a total nominal horsepower of about 26,000. Carnegie, p 195    Boulton proved to be an excellent businessman, and both men eventually made fortunes.', 'id': 1960}
---
{'passage': "Watt retired in 1800, the same year that his fundamental patent and partnership with Boulton expired. The famous partnership was transferred to the men's sons, Matthew Boulton and James Watt Jr. William Murdoch was made a partner and the firm prospered.", 'id': 1964}
---
{'passage': "In 1886, Tesla formed his own company, Tesla Electric Light & Manufacturing. The initial financial investors disagreed with Tesla on his plan for an alternating current motor and eventually relieved him of his duties at the company. Tesla worked in New York as a common laborer from 1886 to 1887 to feed himself and raise capital for his next project. In 1887, he constructed the initial brushless alternating current induction motor, which he demonstrated to the American Institute of Electrical Engineers (now IEEE) in 1888. In the same year, he developed the principles of his Tesla coil and began working with George Westinghouse at Westinghouse Electric & Manufacturing Company's Pittsburgh labs. Westinghouse listened to his ideas for polyphase systems which would allow transmission of alternating current electricity over large distances.", 'id': 1403}

{'passage': "For his gallantry at San Juan Hill, Roosevelt's commanders recommended him for the Medal of Honor, but his subsequent telegrams to the War Department complaining about the delays in returning American troops from Cuba doomed his chances. In the late 1990s, Roosevelt's supporters again took up the flag on his behalf and overcame opposition from elements within the U.S. Army and the National Archives. On January 16, 2001, President Bill Clinton awarded Theodore Roosevelt the Medal of Honor posthumously for his charge up San Juan Hill, Cuba, during the Spanish-American War. Roosevelt's eldest son, Brigadier General Theodore Roosevelt, Jr., received the Medal of Honor for heroism at the Battle of Normandy in 1944. The Roosevelts thus became one of only two father-son pairs to receive this honor.", 'id': 3012}
---
{'passage': 'For his naval service, Gerald Ford earned the Asiatic-Pacific Campaign Medal with nine engagement stars for operations in the Gilbert Islands, Bismarck Archipelago, Marshall Islands, Asiatic and Pacific carrier raids, Hollandia, Marianas, Western Carolines, Western New Guinea, and the Leyte Operation. He also received the Philippine Liberation Medal with two bronze stars for Leyte and Mindoro, as well as the American Campaign and World War II Victory medals.', 'id': 2019}
---
{'passage': "Under his leadership, the Rough Riders became famous for dual charges up Kettle Hill and San Juan Hill in July 1898 (the battle was named after the latter hill).  Out of all the Rough Riders, Roosevelt was the only one who had a horse, and was forced to walk up Kettle Hill on foot after his horse, Little Texas, became tired. For his actions, Roosevelt was nominated for the Medal of Honor which was subsequently disapproved.  It has been widely speculated this disapproval was because of Roosevelt's outspoken comments of the handling of the War. In September 1997, Congressman Rick Lazio representing the 2nd District of New York sent two award recommendations to the U.S. Army Military Awards Branch. These recommendations addressed to Brigadier General Earl Simms, the Army's Adjutant General and one to Master Sergeant Gary Soots, Chief of Authorizations, would prove successful in garnering the much sought after award. Soots Letter  Roosevelt was posthumously awarded the Medal of Honor in 2001 for his actions. Brands ch 13  He was the first and, as of 2007, the only President of the United States to be awarded with America's highest military honor, and the only person in history to receive both his nation's highest honor for military valor and the world's foremost prize for peace.    Chicago newspaper sees cowboy-TR campaigning for governor", 'id': 2922}
---
{'passage': "#In 2001, he became the first and only President up to date to receive a Medal of Honor, making him the only person to date to win the world's highest peace honor, as well as his nation's top military honor. ", 'id': 2967}
---
{'passage': "Roosevelt's legacy includes several other important commemorations.  Roosevelt was included with George Washington, Thomas Jefferson and Abraham Lincoln at the Mount Rushmore Memorial, designed in 1927.  The United States Navy named two ships for Roosevelt: the USS Theodore Roosevelt (SSBN-600), a submarine was in commission from 1961 to 1982; and the USS Theodore Roosevelt (CVN-71), an aircraft carrier that has been on active duty in the Atlantic Fleet since 1986.", 'id': 3013}

{'passage': "Liechtenstein is the fourth smallest country of Europe, after the Vatican City, Monaco, and San Marino. Its population is primarily ethnic Alemannic, although its resident population is approximately one third foreign-born, primarily German speakers from the Federal Republic of Germany, Austria, and the Swiss Confederation, other Swiss, Italians, and Turks. Foreign-born people make up two-thirds of the country's workforce. Nationals are referred to by the plural: Liechtensteiners.", 'id': 2856}
---
{'passage': "Liechtenstein participates in a customs union with Switzerland and employs the Swiss franc as national currency. The country imports more than 90% of its energy requirements. Liechtenstein has been a member of the European Economic Area (an organization serving as a bridge between the European Free Trade Association (EFTA) and the European Union) since May 1995 . The government is working to harmonize its economic policies with those of an integrated Europe. Since 2002, Liechtenstein's rate of unemployment has doubled, although it stood at only 2.2% in the third quarter of 2004. Currently, there is only one hospital in Liechtenstein, the Liechtensteinisches Landesspital in Vaduz. The GDP (PPP) is $1.786 billion CIA World Factbook ( link)  and $25,000 per person.", 'id': 2852}
---
{'passage': 'Liechtenstein is situated in the Upper Rhine valley of the European Alps. The entire western border of Liechtenstein is formed by the river. Measured north to south, the country is only about fifteen miles (24 km) long. In its eastern portion, Liechtenstein rises to higher altitudes; its highest point, the Grauspitz, reaches 2,599 metres (8,527  ). Despite its alpine location, prevailing southerly winds make the climate of Liechtenstein comparatively mild. In winter, the mountain slopes are well suited to winter sports.', 'id': 2844}
---
{'passage': 'The Principality of Liechtenstein (  ( , ( ) is a tiny, doubly landlocked alpine country in Western Europe, bordered by Switzerland to its west and by Austria to its east. Mountainous, it is a winter sports resort, although it is perhaps best known as a tax haven. Despite this, it is not heavily urbanized. Many cultivated fields and small farms characterize its landscape both in the north (Unterland) and in the south (Oberland). It is the smallest German-speaking country in the world.', 'id': 2817}
---
{'passage': "Note: In March 2003 the results of a national referendum showed that nearly two-thirds of Liechtenstein's electorate agreed to vote in support of Hans-Adam II's proposal of a renewed constitution which replaced the version of 1921. The implications of the referendum, the actual changes to the governance of Liechtenstein, and the repercussions of the vote in the wider context of Europe, are yet unknown.", 'id': 2840}

{'passage': "Wolves have bulky coats consisting of two layers. The first layer is made up of tough guard hairs designed to repel water and dirt. The second is a dense, water-resistant undercoat that insulates. The undercoat is shed in the form of large tufts of fur in late spring or early summer (with yearly variations). A wolf will often rub against objects such as rocks and branches to encourage the loose fur to fall out. The undercoat is usually gray regardless of the outer coat's appearance. Wolves have distinct winter and summer pelages that alternate in spring and autumn. Females tend to keep their winter coats further into the spring than males. North American wolves typically have longer, silkier fur than their Eurasian counterparts.", 'id': 1031}
---
{'passage': "Fur coloration varies greatly, running from gray to gray-brown, all the way through the canine spectrum of white, red, brown, and black. These colors tend to mix in many populations to form predominantly blended individuals, though it is certainly not uncommon for an individual or an entire population to be entirely one color (usually all black or all white). A multicolor coat characteristically lacks any clear pattern other than it tends to be lighter on the animal's underside. Fur color sometimes corresponds with a given wolf population's environment; for example, all-white wolves are much more common in areas with perennial snow cover. Aging wolves acquire a grayish tint in their coats.", 'id': 1032}
---
{'passage': "Bristled hairs and blunt claws enhance grip on slippery surfaces, and special blood vessels keep paw pads from freezing.    Scent glands located between a wolf's toes leave trace chemical markers behind, helping the wolf to effectively navigate over large expanses while concurrently keeping others informed of its whereabouts.  Unlike dogs and coyotes, wolves lack sweat glands on their paw pads. This trait is also present in Eastern Canadian Coyotes which have been shown to have recent wolf ancestry.    Wolves in Israel are unique due to the middle two toes of their paws being fused, a trait originally thought to be unique to the African Wild Dog.", 'id': 1029}
---
{'passage': "Wolves are also bred for their fur in a very few locations, but they are considered as a rather problematic animal to breed, and, combined with the low value of the pelt, most fur farms utilize other animals. Wolves' varied coats make it difficult to create fur coats.", 'id': 1168}
---
