{'passage': 'New surveys of the country\'s borders in 2006  have set its area at 160.475 square kilometres, with borders of 77.9 km.  "Tiny Liechtenstein gets a little bigger," December 29, 2006  Thus, Liechtenstein discovered in 2006 that its borders are 1.9 km (1.2 miles) longer than previously thought as more modern measuring methods have been introduced and they measure more accurately the borders in mountainous regions.  Liechtenstein redraws Europe map, BBC News, December 28 2006', 'id': 2845}
---
{'passage': 'Until the end of World War I, Liechtenstein first was closely tied to the Austrian Empire and later, to Austria-Hungary; however, the economic devastation caused by WWI forced the country to conclude a customs and monetary union with its other neighbor, Switzerland. (Their Army had been disbanded in 1868, out of financial considerations.) At the time of the dissolution of the Austro-Hungarian Empire, it was argued that Liechtenstein as a fief of the Holy Roman Empire (supposedly still incarnated in Liechtensteiner eyes at an abstract level in the person of the then-dethroned Austro-Hungarian Emperor, despite its formal dissolution in 1806) was no longer bound to Austria, then emerging as an independent state, which did not consider itself as the legal successor to the Empire. Liechtenstein is thus the last independent state in Europe which can claim an element of continuity from the Holy Roman Empire.', 'id': 2828}
---
