{'passage': "The polar bear (Ursus maritimus) is a bear native to the Arctic. Polar bears and Kodiak bears are the world's largest land carnivores, with most adult males weighing 300-600 kg (660-1320 lb); adult females are about half the size of males. Its fur is hollow and translucent, but usually appears as white or cream colored, thus providing the animal with effective camouflage.  Its skin is actually black in color. Its thick blubber and fur insulate it against the cold. The bear has a short tail and small ears that help reduce heat loss, as well as a relatively small head and long, tapered body to streamline it for swimming.", 'id': 2591}
---
{'passage': 'Though it spends time on land and ice, the polar bear is regarded as a marine mammal due to its intimate relationship with the sea.  The circumpolar species is found in and around the Arctic Ocean, its southern range limited by pack ice. Their southernmost point is James Bay in Canada. While their numbers thin north of 88 degrees, there is evidence of polar bears all the way across the Arctic. Population is estimated to be between 20,000 to 25,000.', 'id': 2618}
---
{'passage': 'Because of the inaccessibility of the Arctic, there has never been a comprehensive global survey of polar bears, making it difficult to establish a global trend. The earliest preliminary estimates of the global population were around 5,000-10,000 in the early 1970s, but this was revised to 20,000-40,000 in the 1980s.    Part of this increase may indicate recovery as a result of conservation measures implemented in the early 1970s, but it is principally a revised estimate based on a growing base of data.  Current estimates bound the global population between 20,000-25,000.  Long-term studies of local populations of polar bears show they have been shrinking in the Western Hudson Bay and Baffin Bay areas, and are under stress in the Southern Beaufort Sea area.   In the Western Hudson Bay in Canada, for example, there were an estimated 1194 polar bears in 1987, and 935 in 2004.  .', 'id': 2643}
---
{'passage': 'When the polar bear was originally documented, two subspecies were identified: Ursus maritimus maritimus by Constantine J. Phipps in 1774, and Ursus maritimus marinus by Peter S. Pallas in 1776.  .  This distinction has since been invalidated. The IUCN/SSC Polar Bear Specialist Group (PBSG), the pre-eminent international scientific body for research and management of polar bears, recognizes only one species distributed in nineteen discrete subpopulations across five countries.  ', 'id': 2609}
---
{'passage': 'Polar bears are excellent swimmers and have been seen in open Arctic waters as far as   from land. In some cases they spend half their time on ice floes. Their 12 cm (5 in) layer of fat adds buoyancy in addition to insulating them from the cold. Recently, polar bears in the Arctic have undertaken longer than usual swims to find prey, resulting in four recorded drownings in the unusually large ice pack regression of 2005.  .', 'id': 2629}

