{'passage': "The Republic of Indonesia ( ) ( ), is a nation in Southeast Asia. Comprising 17,508 islands, it is the world's largest archipelagic state. With a population of over 234 million people, it is the world's fourth most populous country and the most populous Muslim-majority nation, although officially it is not an Islamic state. Indonesia is a republic, with an elected parliament and president. The nation's capital city is Jakarta. The country shares land borders with Papua New Guinea, East Timor and Malaysia. Other neighboring countries include Singapore, the Philippines, Australia, and the Indian territory of the Andaman and Nicobar Islands.", 'id': 751}
---
{'passage': "Indonesia consists of 17,508 islands, about 6,000 of which are inhabited.  ;    These are scattered over both sides of the equator. The five largest islands are Java, Sumatra, Kalimantan (the Indonesian part of Borneo), New Guinea (shared with Papua New Guinea), and Sulawesi. Indonesia shares land borders with Malaysia on the island of Borneo, Sebatik, Papua New Guinea on the island of New Guinea, and East Timor on the island of Timor.  Indonesia also shares borders with Singapore, Malaysia, and the Philippines to the north and Australia to the south across narrow straits of water.  The capital, Jakarta, is on Java and is the nation's largest city, followed by Surabaya, Bandung, Medan, and Semarang.", 'id': 796}
---
{'passage': 'Lying along the equator, Indonesia has a tropical climate, with two distinct monsoonal wet and dry seasons. Average annual rainfall in the lowlands varies from 1,780â\x80\x933,175 millimeters (70â\x80\x93125 in), and up to 6,100 millimeters (240 in) in mountainous regions. Mountainous areas particularly in the west coast of Sumatra, West Java, Kalimantan, Sulawesi, and Papua receive the highest rainfall. Humidity is generally high, averaging about 80%. Temperatures vary little throughout the year; the average daily temperature range of Jakarta is 26â\x80\x9330 Â°C (79â\x80\x9386 Â°F).', 'id': 800}
---
{'passage': "At 1,919,440 square kilometers (741,050 sq mi), Indonesia is the world's 16th-largest country in terms of land area.    Its average population density is 134 people per square kilometer (347 per sq mi), 79th in the world,    although Java, the world's most populous island,    has a population density of 940 people per square kilometer (2,435 per sq mi). At 4,884 meters (16,024 ft), Puncak Jaya in Papua is Indonesia's highest peak, and Lake Toba in Sumatra its largest lake, with an area of 1,145 square kilometers (442 sq mi). The country's largest rivers are in Kalimantan, and include the Mahakam and Barito; such rivers are communication and transport links between the island's river settlements.", 'id': 797}
