{'passage': "Elephants are mammals, and the largest land animals alive today.    The elephant's gestation period is 22 months, the longest of any land animal. At birth it is common for an elephant calf to weigh 120 kilograms (265 lb).  An elephant may live as long as 70 years, sometimes longer. The largest elephant ever recorded was shot in Angola in 1956. This male weighed about 12,000 kg (26,400 lb),    with a shoulder height of 4.2 m (13.8 ft), a metre (3 ft 4 in) taller than the average male African elephant.    The smallest elephants, about the size of a calf or a large pig, were a prehistoric species that lived on the island of Crete during the Pleistocene epoch. Bate, D.M.A. 1907. On Elephant Remains from Crete, with Description of Elephas creticus sp.n. Proc. zool. Soc. London: 238-250.", 'id': 1177}
---
{'passage': 'Elephants have been working animals used in various capacities by humans. Seals found in the Indus Valley suggest that the elephant was first domesticated in ancient India. However, elephants have never been truly domesticated: the male elephant in his periodic condition of musth is dangerous and difficult to control. Therefore elephants used by humans have typically been female, war elephants being an exception, however: as female elephants in battle will run from a male, only males could be used in war. It is generally more economical to capture wild young elephants and tame them than breeding them in captivity (see also elephant "crushing").', 'id': 1276}

{'passage': 'Turtles are divided into three suborders, one of which, the Paracryptodira, is extinct. The two extant suborders are the Cryptodira and the Pleurodira. The Cryptodira is the larger of the two groups and includes all the marine turtles, the terrestrial tortoises, and many of the freshwater turtles. The Pleurodira are sometimes known as the side-necked turtles, a reference to the way they withdraw their heads into their shells. This smaller group consists primarily of various freshwater turtles.', 'id': 2691}
---
{'passage': '* Pritchard, Pether C H (1979). Encyclopedia of Turtles. T.F.H. Publications.', 'id': 2696}
---
{'passage': 'Turtles are reptilians of the Order Testudines (all living turtles belong to the crown group Chelonia), most of whose body is shielded by a special bony or cartilaginous shell developed from their ribs. The Order Testudines includes both extant (living) and extinct species, the earliest known turtles being from around 215 million years ago,  /ref> making turtles one of the oldest reptile groups, and a much more ancient group than lizards and snakes.  About 300 species are alive today; some are highly endangered.', 'id': 2683}
---
{'passage': 'Like other reptiles, turtles are ectothermic (or "cold-blooded" Reptile blood isn\'t necessarily cold, as reptiles sun themselves and take other measures to stay warm. ). Like other amniotes (reptiles, dinosaurs, birds, and mammals), they breathe air and don\'t lay eggs underwater, though many species live in or around water. The largest turtles are aquatic.', 'id': 2684}
---
{'passage': 'Turtles lay eggs, like other reptiles, which are slightly soft and leathery. The eggs of the largest species are spherical, while the eggs of the rest are elongated. Their albumen is white and contains a different protein than bird eggs, such that it will not coagulate when cooked. Turtle eggs prepared to eat consist mainly of yolk. In some species, temperature determines whether an egg develops into a male or a female: a higher temperature causes a female, a lower temperature causes a male. Large numbers of eggs are deposited in holes dug into mud or sand. They are then covered and left to incubate by themselves.  When the turtles hatch they squirm their way to the surface and make for the water. There are no known species wherein the mother cares for the young.', 'id': 2687}

{'passage': 'According to the Constitution of Egypt, any new legislation must at least implicitly agree with Islamic laws. The mainstream Hanafi school of Sunni Islam is largely organised by the state, through Wizaret Al-Awkaf (Ministry of Religious Affairs). Al-Awkaf controls all mosques and overviews Muslim clerics. Imams are trained in Imam vocational schools and at Al-Azhar University. The department supports Sunni Islam and has commissions authorised to give Fatwa judgements on Islamic issues.', 'id': 914}
---
{'passage': "Egypt is predominantly Muslim, at 80-90% of the population, with the majority being adherents of the Sunni branch of Islam.  A significant number of Muslim Egyptians also follow native Sufi orders, Hoffman, Valerie J. Sufism, Mystics, and Saints in Modern Egypt. University of South Carolina Press, 1995.  and a minority of Shi'a.", 'id': 912}
---
{'passage': 'Religion plays a central role in most Egyptians\' lives. The rolling calls to prayer that are heard five times a day have the informal effect of regulating the pace of everything from business to entertainment. Cairo is famous for its numerous mosque minarets and church towers. This religious landscape has been marred by a record of religious extremism.    Most recently,  a December 16 2006 judgment of the Supreme Administrative Court of Egypt insisted on a clear demarcation between "recognized religions"â\x80\x94Islam, Christianity and Judaismâ\x80\x94and all other religious beliefsâ\x80\x94thus effectively delegitimatizing and forbidding practice of all but these aforementioned religions.     This judgment has led to the requirement for communities to either commit perjury or be subjected to denial of identification cards.', 'id': 911}
---
{'passage': "Egypt hosts two major religious institutions. Al-Azhar University ( ) is the oldest Islamic institution of higher studies (founded around 970 A.D) and considered by many to be the oldest extant university. The Coptic Orthodox Church of Alexandria, headed by the Pope of the Coptic Orthodox Church of Alexandria, attests to Egypt's strong Christian heritage. It has a following of approximately 15 million Christians worldwide; affiliated sister churches are located in Armenia, Ethiopia, Eritrea, India, Lebanon and Syria.", 'id': 915}
---
{'passage': "Religious freedom in Egypt is hampered to varying degrees by extremist Islamist groups and by discriminatory and restrictive government policies. Being the largest religious minority in Egypt, Coptic Christians are the most negatively affected community. Copts have faced increasing marginalization after the 1952 coup d'Ã©tat led by Gamal Abdel Nasser. Until recently, Christians were required to obtain presidential approval for even minor repairs in churches. Although the law was eased in 2005 by handing down the authority of approval to the governors, Copts continue to face many obstacles in building new or repairing existing churches. These obstacles are not found in building mosques. WorldWide Religious News.  Church Building Regulations Eased. December 13, 2005.  Compass Direct News.  Church Building Regulations Eased. December 13, 2005.", 'id': 916}

{'passage': "Lincoln's formal education consisted of about 18 months of schooling. Largely self-educated, he read every book he could get his hands on, once walking.  just to borrow one  While his favorite book was The Life of George Washington, Lincoln mastered the Bible, Shakespeare, and English and American history, and developed a plain writing style that puzzled audiences more used to grandiose rhetoric. He was also a talented local wrestler and skilled with an ax; some rails he had allegedly split in his youth were exhibited at the 1860 Republican National Convention, as the party celebrated the poor-boy-made-good theme. Lincoln avoided hunting and fishing because he did not like killing animals, even for food. Though he was unusually tall at  , 4 inches and strong, Lincoln spent so much time reading that some neighbors suspected he must be doing it to avoid strenuous manual labor.", 'id': 287}
---
{'passage': 'Young "Teedie" , as he was nicknamed as a child, (the nickname "Teddy" was from his first wife, Alice Hathaway Lee, and he later harbored an intense dislike for it) was mostly home schooled by tutors and his parents. A leading biographer says: "The most obvious drawback to the home schooling Roosevelt keely received was uneven coverage of the various areas of human knowledge." He was solid in geography (thanks to his careful observations on all his travels) and very well read in history, strong in biology, French and German, but deficient in mathematics, Latin and Greek.  Brands T. R. p. 49â\x80\x9350  He matriculated at Harvard College in 1876, graduating magna cum laude. His father\'s death in 1878 was a tremendous blow, but Roosevelt redoubled his activities. He did well in science, philosophy and rhetoric courses but fared poorly in Latin and Greek.  He studied biology with great interest and indeed was already an accomplished naturalist and published ornithologist. He had a photographic memory and developed a life-long habit of devouring books, memorizing every detail. Brands p. 62  He was an eloquent conversationalist who, throughout his life, sought out the company of the smartest people. He could multitask in extraordinary fashion, dictating letters to one secretary and memoranda to another, while browsing through a new book.', 'id': 2889}
---
{'passage': 'Lincoln was just seven years old when, in 1816, the family was forced to make a new start in Perry County (now in Spencer County), Indiana. He later noted that this move was "partly on account of slavery," and partly because of difficulties with land deeds in Kentucky: Unlike land in the Northwest Territory, Kentucky never had a proper U.S. survey, and farmers often had difficulties proving title to their property. Lincoln was only nine when his mother, then thirty-four years old, died of milk sickness. Soon afterwards, his father remarried  to Sarah Bush Johnston. Sarah Lincoln raised young Lincoln like one of her own children. Years later she compared Lincoln to her own son, saying "Both were good boys, but I must say â\x80\x94 both now being dead that Abe was the best boy I ever saw or ever expect to see." Lincoln was affectionate toward his stepmother, whom he would call "Mother" for the rest of his life, but he was distant from his father.  Donald, (1995) pp. 28, 152.', 'id': 285}
---
{'passage': 'There were few people who strongly or directly influenced Lincolnâ\x80\x99s moral and intellectual development and perspectives. There was no teacher, mentor, church leader, community leader, or peer that Lincoln would credit in later years as a strong influence on his intellectual development. Lacking a formal education, Lincolnâ\x80\x99s personal philosophy was shaped by "an amazingly retentive memory and a passion for reading and learning." It was Lincolnâ\x80\x99s reading, rather than his relationships, that were most influential in shaping his personal beliefs. Guelzo pg. 20. Miller pg. 57-59  Lincolnâ\x80\x99s reading and study of the Bible was an integral part of his intellectual roots.', 'id': 376}
---
{'passage': "In 1830, after more economic and land-title difficulties in Indiana, the family settled on public land  /ref> in Macon County, Illinois. Some scholars believe that it was his father's repeated land-title difficulties and ensuing financial hardships that led young Lincoln to study law.  The following winter was desolate and especially brutal, and the family considered moving back to Indiana. The following year, when his father relocated the family to a new homestead in Coles County, Illinois, twenty-two-year-old Lincoln struck out on his own, canoeing down the Sangamon River to the village of New Salem in Sangamon County. Later that year, hired by New Salem businessman Denton Offutt and accompanied by friends, he took goods from New Salem to New Orleans via flatboat on the Sangamon, Illinois and Mississippi rivers. While in New Orleans, he may have witnessed a slave auction, though as a frequent visitor to Kentucky, he would have had several earlier opportunities to witness  similar sales.  Donald, (1995) ch. 2.", 'id': 286}

{'passage': 'In 1973, Egypt, along with Syria, launched the October War, a surprise attack against the Israeli forces occupying the Sinai Peninsula and the Golan Heights.  It was an attempt to liberate the territory Israel had captured 6 years earlier. Both the US and the USSR intervened and a cease-fire was reached. Despite not being a complete military success, most historians agree that the October War presented Sadat with a political victory that later allowed him to pursue peace with Israel.', 'id': 863}
