{'passage': "Three years after the 1967 Six Day War, during which Israel had invaded and occupied Sinai, Nasser died and was succeeded by Anwar Sadat. Sadat switched Egypt's Cold War allegiance from the Soviet Union to the United States, expelling Soviet advisors in 1972.  He launched the Infitah economic reform policy, while violently clamping down on religious and secular opposition alike.", 'id': 862}
