{'passage': 'During World War II, Finland fought the Soviet Union twice: in the Winter War of 1939 40 after the Soviet Union had attacked Finland and in the Continuation War of 1941 44, following Operation Barbarossa in which Nazi Germany invaded the Soviet Union. Following German losses on the Eastern Front and the subsequent Soviet advance, Finland was forced to make peace with the Soviet Union.  This was followed by the Lapland War of 1944 45, when Finland forced the Germans out of northern Finland.', 'id': 1571}
