{'passage': "In 1977, Sadat made a historic visit to Israel, which led to the 1979 peace treaty in exchange for the complete Israeli withdrawal from Sinai. Sadat's initiative sparked enormous controversy in the Arab world and led to Egypt's expulsion from the Arab League, but it was supported by the vast majority of Egyptians. Vatikiotis, p. 443  A fundamentalist military soldier assassinated Sadat in Cairo in 1981.  He was succeeded by the incumbent Hosni Mubarak. In 2003, the Egyptian Movement for Change, popularly known as Kifaya, was launched to seek a return to democracy and greater civil liberties.", 'id': 864}

{'passage': 'Romania is a secular state, thus having no national religion. The dominant religious body is the Romanian Orthodox Church; its members make up 86.7% of the population according to the 2002 census. Other important religions include Roman Catholicism (4.7%), Protestantism (3.7%), Pentecostal denominations (1.5%) and the Romanian Greek-Catholic Church (0.9%).  Romania also has a historically significant Muslim minority concentrated in Dobrogea, mostly of Turkish ethnicity and numbering 67,500 people.     Romanian Census Website with population by religion  Based on the 2002 census data, there are also 6,179 Jews, 23,105 people who are of no religion and/or atheist, and 11,734 who refused to answer. On December 27, 2006, a new Law on Religion was approved under which religious denominations can only receive official registration if they have at least 20,000 members, or about 0.1 percent of Romania\'s total population.  Romania President Approves Europe\'s "Worst Religion Law"', 'id': 3107}
---
{'passage': 'Romania is a semi-presidential unitary state. As a nation-state, the country was formed by the merging of Moldavia and Wallachia in 1859 and it gained recognition of its independence in 1878. Later, in 1918, they were joined by Transylvania, Bukovina and Bessarabia. At the end of World War II, parts of its territories (roughly the present day Moldova) were occupied by USSR and Romania became a member of Warsaw Pact. With the fall of the Iron Curtain in 1989, Romania started a series of political and economic reforms that peaked with Romania joining the European Union.', 'id': 3047}
---
{'passage': 'Romania has its unique culture, which is the product of its geography and of its distinct historical evolution. Like Romanians themselves, it is fundamentally defined as the meeting point of three regions: Central Europe, Eastern Europe, and the Balkans, but cannot be truly included in any of them.  ROMANIA - CULTURE  The Romanian identity formed on a substratum of mixed Roman and quite possibly Dacian elements,    with many other influences. During late Antiquity and the Middle Ages, the major influences came from the Slavic peoples who migrated and settled in nearby Bulgaria, Serbia, Ukraine and eventually Russia;  from medieval Greeks and the Byzantine Empire;  from a long domination by the Ottoman Empire;  from the Hungarians;  and from the Germans living in Transylvania. Modern Romanian culture emerged and developed over roughly the last 250 years under a strong influence from Western culture, particularly French  and German culture.', 'id': 3129}
---
