{'passage': "Roosevelt's attacks on Wilson helped the Republicans win control of Congress in the off-year elections of 1918. Roosevelt was popular enough to seriously contest the 1920 Republican nomination, but his health was broken by 1918, because of the lingering malaria. His son Quentin, a daring pilot with the American forces in France, was shot down behind German lines in 1918. Quentin was his youngest son and probably the most liked by him. It is said the death of his son distressed him so much that Roosevelt never recovered from his loss. Dalton, (2002)p 507", 'id': 2998}
