{'passage': "Upon his return to New York, friends and family were startled by Roosevelt's physical appearance and fatigue. Roosevelt wrote to a friend that the trip had cut his life short by ten years. He might not have really known just how accurate that analysis would prove to be, because the effects of the South America expedition had so greatly weakened him that they significantly contributed to his declining health. For the rest of his life, he would be plagued by flareups of malaria and leg inflammations so severe that they would require hospitalization.  Thayer, Chapter XXIII, pp. 4â\x80\x937.", 'id': 2994}
