{'passage': 'Qatar explicitly uses Sunni law as the basis of its government, and the vast majority of its citizens follow Hanbali Madhhab. Hanbali (Arabic: Ø\xadÙ\x86Ø¨Ù\x84Ù\x89 ) is one of the four schools (Madhhabs) of Fiqh or religious law within Sunni Islam (The other three are Hanafi, Maliki and Shafii). Sunni Muslims believe that all four schools have "correct guidance", and the differences between them lie not in the fundamentals of faith, but in finer judgements and jurisprudence, which are a result of the independent reasoning of the imams and the scholars who followed them. Because their individual methodologies of interpretation and extraction from the primary sources (usul) were different, they came to different judgements on particular matters.', 'id': 2580}
