{'passage': 'Romania has its unique culture, which is the product of its geography and of its distinct historical evolution. Like Romanians themselves, it is fundamentally defined as the meeting point of three regions: Central Europe, Eastern Europe, and the Balkans, but cannot be truly included in any of them.  ROMANIA - CULTURE  The Romanian identity formed on a substratum of mixed Roman and quite possibly Dacian elements,    with many other influences. During late Antiquity and the Middle Ages, the major influences came from the Slavic peoples who migrated and settled in nearby Bulgaria, Serbia, Ukraine and eventually Russia;  from medieval Greeks and the Byzantine Empire;  from a long domination by the Ottoman Empire;  from the Hungarians;  and from the Germans living in Transylvania. Modern Romanian culture emerged and developed over roughly the last 250 years under a strong influence from Western culture, particularly French  and German culture.', 'id': 3129}

{'passage': "All official holidays in Finland are established by acts of Parliament. The official holidays can be divided into Christian and secular holidays, although some of the Christian holidays have replaced holidays of pagan origin. The main Christian holidays are Christmas, Epiphany, Easter, Ascension Day, Pentecost, and All Saints Day. The secular holidays are New Year's Day, May Day, Midsummer Day, and the Independence Day. Christmas is the most extensively celebrated holiday: usually at least 23rd to 26th of December are holidays.", 'id': 1707}
---
{'passage': 'Egypt is famous for its many festivals and religious carnivals, also known as mulids or Mawlid. They are usually associated with a particular Coptic or Sufi saint, but are often celebrated by all Egyptians irrespective of creed or religion. Ramadan has a special flavor in Egypt, celebrated with sounds, lights (local lanterns known as fawanees) and much flare that many Muslim tourists from the region flock to Egypt during Ramadan to witness the spectacle. The ancient spring festival of Sham en Nisim (Coptic:   shom en nisim) has been celebrated by Egyptians for thousands of years, typically between the Egyptian months of Paremoude (April) and Pashons (May), following Easter Sunday.', 'id': 932}
---
{'passage': "In addition to this, all Sundays are official holidays, but they are not as important as the special holidays. The names of the Sundays follow the liturgical calendar and they can be categorised as Christian holidays. When the standard working week in Finland was reduced to 40 hours by an act of Parliament, it also meant that all Saturdays became a sort of de facto public holidays, though not official ones. Easter Sunday and Pentecost are Sundays that form part of a main holiday and they are preceded by a kind of special Saturdays. Retail stores are prohibited by law from doing business on Sundays, except during the summer months (May through August) and in the pre-Christmas season (November and December). Business locations that have less than 400 square metres of floor space are allowed Sunday business throughout the year, with the exception of official holidays and certain Sundays, such as Mother's Day and Father's Day.", 'id': 1708}
---
{'passage': "Abraham Lincoln's birthday, February 12, was formerly a national holiday, now commemorated as Presidents' Day. However, it is still observed in Illinois and many other states as a separate legal holiday, Lincoln's Birthday. A dozen states have legal holidays celebrating the third Monday in February as 'Presidents' Day' as a combination Washington-Lincoln Day.", 'id': 387}
---
{'passage': "Although many tourists visit for the ideal weather during the summer, winter also attracts hundreds of thousands for its Christmas festivities and winter sports and activities such as skiing, dog sledding and Nordic walking. Finland is regarded as the home of Saint Nicholas or Santa Claus. Santaâ\x80\x99s Post Office is also located in Finland, up in the northern Lapland region. Above the Arctic Circle, there is a polar night, a period when the sun doesn't rise for days or weeks, or even months. Lapland, the extreme north of Finland, is so far north that the Aurora Borealis, atmospheric fluorescence, is seen regularly in winter. This exquisite spectacle draws people from around the globe, particularly from Japan.", 'id': 1672}

{'passage': 'Otters are amphibious (or in one case aquatic) carnivorous mammals.  The otter subfamily Lutrinae forms part of the family Mustelidae, which also includes weasels, polecats, badgers, as well as others. With 13 species in 7 genera, otters have an almost worldwide distribution.', 'id': 1913}
---
{'passage': 'The northern river otter (Lontra canadensis) became one of the major animals hunted and trapped for fur in North America after European contact. As one of the most playful, curious, and active species of otter, they have become a popular exhibit in zoos and aquaria, but unwelcome on agricultural land because they alter river banks for access, sliding, and defense . River otters eat a variety of fish and shellfish, as well as small land mammals and birds.  They grow to 1 m (3 to 4 feet) in length and weigh from 5 to 15 kg (10 to 30 pounds).', 'id': 1922}
---
{'passage': 'In some Native American cultures, otters are considered totem animals. The time of year associated with this is also associated with the Aquarius sign of the Zodiac, through which the sun passes January 20-February 19.', 'id': 1934}
---
{'passage': 'Most otters have fish as the primary item in their diet, supplemented by frogs, crayfish and crabs.  Some are expert at opening shellfish, and others will take any available small mammals or birds.  This prey-dependence leaves otters very vulnerable to prey depletion.', 'id': 1918}
---
{'passage': 'Otters do not depend on their specialized fur alone for survival in the cold waters where many live: they also have very high metabolic rates. For example Eurasian otters must eat 15% of their body-weight a day, and sea otters, 20 to 25%, depending on the temperature. In water as warm as 10Â°C an otter needs to catch 100 g of fish per hour to survive.  Most species hunt for 3 to 5 hours a day, and nursing mothers up to 8 hours a day.', 'id': 1917}

{'passage': "When his presidency expired on March 4, 1825, James Monroe lived at Monroe Hill on the grounds of the University of Virginia.  This university's modern campus was Monroe's family farm from 1788 to 1817, but he had sold it in the first year of his presidency to the new college.  He served on the college's Board of Visitors under Jefferson and then under the second rector and another former President James Madison, until his death.", 'id': 2520}
