{'passage': "As president of the Senate, Adams cast 31 tie-breaking votesâ\x80\x94a record that only John C. Calhoun came close to tying, with 28.  Ferling (1992) p 311  His votes protected the president's sole authority over the removal of appointees and influenced the location of the national capital. On at least one occasion, he persuaded senators to vote against legislation that he opposed, and he frequently lectured the Senate on procedural and policy matters. Adams's political views and his active role in the Senate made him a natural target for critics of the Washington administration. Toward the end of his first term, as a result of a threatened resolution that would have silenced him except for procedural and policy matters, he began to exercise more restraint.  When the two political parties formed, he joined the Federalist Party, but never got on well with its dominant leader Alexander Hamilton. Because of Adams's seniority and the need for a northern president, he was elected as the Federalist  nominee for president in 1796, over Thomas Jefferson, the leader of the opposition Democratic-Republican Party. His success was due to peace and prosperity; Washington and Hamilton had averted war with Britain by the Jay Treaty of 1795.  Ferling (1992) pp 316-32", 'id': 673}

{'passage': 'Kangaroos are the only large animals to use hopping as a means of locomotion. The comfortable hopping speed for Red Kangaroo is about 20 25 km/h (13 16 mph), but speeds of up to 70 km/h (44 mph) can be attained, over short distances, while it can sustain a speed of 40 km/h (25 mph) for  nearly two kilometres.    This fast and energy-efficient method of travel has evolved because of the need to regularly cover large distances in search of food and water, rather than the need to escape predators.', 'id': 1738}
---
{'passage': 'A collision with a vehicle is capable of killing a kangaroo. Kangaroos dazzled by headlights or startled by engine noise have been known to leap in front of cars.  Since kangaroos in mid-bound can reach speeds of around 50 km/h (31 mph) and are relatively heavy, the force of impact can be severe.  Small vehicles may be destroyed, while larger vehicles may suffer engine damage. The risk of harm to vehicle occupants is greatly increased if the windscreen is the point of impact.  As a result, "kangaroo crossing" signs are commonplace in Australia.', 'id': 1762}
---
{'passage': 'There is also a link between the hopping action and breathing: as the feet leave the ground, air is expelled from the lungs; bringing the feet forward ready for landing refills the lungs, providing further energy efficiency. Studies of kangaroos and wallabies have demonstrated that, beyond the minimum energy expenditure required to hop at all, increased speed requires very little extra effort (much less than the same speed increase in, say, a horse, dog or human), and that the extra energy is required to carry extra weight. For kangaroos, the key benefit of hopping is not speed to escape predators the top speed of a kangaroo is no higher than that of a similarly-sized quadruped, and the Australian native predators are in any case less fearsome than those of other continents but economy: in an infertile continent with highly variable weather patterns, the ability of a kangaroo to travel long distances at moderately high speed in search of food sources is crucial to survival.', 'id': 1752}
---
{'passage': 'Before European settlement, the kangaroo was a very important animal for Australian Aborigines, for its meat, hide, bones and sinews. In addition, there were important Dreaming stories and ceremonies involving the kangaroo.  Aherrenge is a current kangaroo dreaming site in the Northern Territory. The game of Marn grook was played using a ball made from kangaroo  by the Kurnai people.', 'id': 1755}
---
{'passage': "Europeans have long regarded Kangaroos as strange animals. Early explorers described them as creatures that had heads like deer (without antlers), stood upright like men, and hopped like frogs.  Combined with the two-headed appearance of a mother kangaroo, this led many back home to dismiss them as travellers' tales for quite some time.", 'id': 1736}

