{'passage': 'Under the new two species classification, Loxodonta africana refers specifically to the Savanna Elephant, the largest of all elephants. In fact, it is the largest land animal in the world, standing up to 4 m (13 ft) at the shoulder and weighing approximately 7,000 kg (7.7 tons). The average male stands about 3 m (10 ft) tall at the shoulder and weighs about 5500â\x80\x936000 kg (6.1â\x80\x936.6 tons), the female being much smaller. Most often, Savanna Elephants are found in open grasslands, marshes, and lakeshores. They range over much of the savanna zone south of the Sahara.', 'id': 1192}
---
{'passage': 'The smallest of all the elephants is the Sumatran Elephant (Elephas maximus sumatranus). Population estimates for this group range from 2,100 to 3,000 individuals. It is very light grey and has less depigmentation than the other Asians, with pink spots only on the ears. Mature Sumatrans will usually only measure 1.7â\x80\x932.6 m (5.6â\x80\x938.5 ft) at the shoulder and weigh less than 3,000 kg (6,600 lb). An enormous animal nonetheless, it is considerably smaller than its other Asian (and African) cousins and exists only on the island of Sumatra, usually in forested regions and partially wooded habitats.', 'id': 1204}
---
{'passage': 'The other postulated species is the Forest Elephant (Loxodonta cyclotis). Compared with the Savanna Elephant, its ears are usually smaller and rounder, and its tusks thinner and straighter and not directed outwards as much. The Forest Elephant can weigh up to 4,500 kg (10,000 lb) and stand about 3 m (10 ft) tall. Much less is known about these animals than their savanna cousins because environmental and political obstacles make them difficult to study. Normally, they inhabit the dense African rain forests of central and western Africa, though occasionally they roam the edges of forests and so overlap the territories of the Savanna elephants and breed with them. In 1979, Iain Douglas-Hamilton estimated the continental population of African elephants at around 1.3 million animals.    This estimate is controversial and is believed to be a gross overestimate ,    but it is very widely cited and has become a de facto baseline that continues to be incorrectly used to quantify downward population trends in the species. Through the 1980s, Loxodonta received worldwide attention due to the dwindling numbers of major populations in East Africa, largely as a result of poaching. Today, according to IUCNâ\x80\x99s African Elephant Status Report 2007   ', 'id': 1193}

