{'passage': 'Eagle Scout Gerald Ford (circled in red) in 1929.', 'id': 2000}
---
{'passage': 'Despite his debilitating diseases, Roosevelt remained active to the end of his life. He was an enthusiastic proponent of the Scouting movement. The Boy Scouts of America gave him the title of Chief Scout Citizen, the only person to hold such title. One early Scout leader said, "The two things that gave Scouting great impetus and made it very popular were the uniform and Teddy Roosevelt\'s jingoism." Larson, Keith (2006).  "Theodore Roosevelt". Retrieved March 6 2006.', 'id': 3001}
---
{'passage': 'For his naval service, Gerald Ford earned the Asiatic-Pacific Campaign Medal with nine engagement stars for operations in the Gilbert Islands, Bismarck Archipelago, Marshall Islands, Asiatic and Pacific carrier raids, Hollandia, Marianas, Western Carolines, Western New Guinea, and the Leyte Operation. He also received the Philippine Liberation Medal with two bronze stars for Leyte and Mindoro, as well as the American Campaign and World War II Victory medals.', 'id': 2019}
---
{'passage': 'Ford was a member of several civic organizations, including the Benevolent and Protective Order of Elks, American Legion, Veterans of Foreign Wars, and AMVETS.Gerald R. Ford was initiated into Freemasonry on September 30, 1949.  The Supreme Council, Ancient and Accepted Scottish Rite, Southern Jurisdiction, USA.  He later said in 1975,  "When I took my obligation as a master mason â\x80\x94 incidentally, with my three younger brothers â\x80\x94 I recalled the value my own father attached to that order. But I had no idea that I would ever be added to the company of the Father of our Country and 12 other members of the order who also served as Presidents of the United States."', 'id': 2020}

{'passage': "He ran in the election of 1856 as the party's candidate, attempting to win a non-consecutive second term as President (a feat accomplished only once in American politics, by Grover Cleveland).  His running mate was Andrew Jackson Donelson, nephew of former president Andrew Jackson. Fillmore and Donelson finished third, carrying only the state of Maryland and its eight electoral votes; but he won 21.6% of the popular vote, one of the best showings ever by a Presidential third-party candidate.", 'id': 184}
---
{'passage': "Millard Fillmore (January 7, 1800   March 8, 1874) was the thirteenth President of the United States, serving from 1850 until 1853, and the last member of the Whig Party to hold that office. He was the second Vice President to assume the Presidency upon the death of a sitting President, succeeding Zachary Taylor who died of acute gastroenteritis. Fillmore was never elected President; after serving out Taylor's term, he failed to gain the nomination for the Presidency of the Whigs in the 1852 presidential election, and, four years later, in the 1856 presidential election, he again failed to win election as President as the Know Nothing Party and Whig candidate.", 'id': 148}
---
