{'passage': 'Penguins have a thick layer of insulating feathers which are designed to keep them warm in water (heat loss in water is much greater than in air).  The Emperor penguin (the largest penguin) has the largest body mass of all penguins, which further reduces relative surface area and heat loss. They also are able to control blood flow to their extremities, reducing the amount of blood which gets cold, but still keeping the extremities from freezing.  In the extreme cold of the Antarctic winter, the females are at sea fishing for food leaving the males to brave the weather by themselves.  They often huddle together to keep warm and rotate positions to make sure that each penguin gets a turn in the center of the heat pack.', 'id': 963}
---
{'passage': 'Penguins either waddle on their feet or slide on their bellies across the snow, a movement called "tobogganing", which conserves energy while moving quickly.  They also jump with both feet together if they want to move more quickly or cross steep or rocky terrain.', 'id': 961}
---
{'passage': 'Penguins have an average sense of hearing for birds (Wever et al 1969); this is used by parents and chicks to locate one another in crowded colonies (Jouventin et al 1999). Their eyes are adapted for underwater vision, and are their primary means of locating prey and avoiding predators; in air it has been suggested that they are nearsighted, although research has not supported this hypothesis (Sivak et al 1987).', 'id': 962}
---
{'passage': 'Penguins are superbly adapted to an aquatic life. Their wings have become flippers, useless for flight in the air. In the water, however, penguins are astonishingly agile. Within the smooth plumage a layer of air is preserved, ensuring buoyancy. The air layer also helps insulate the birds in cold waters. ', 'id': 957}
---
{'passage': 'Diving penguins reach 6 to 12 km/h (3.7 to 7.5 mph), though there are reports of velocities of 27 km/h (17 mph) (which are more realistic in the case of startled flight). The small penguins do not usually dive deep; they catch their prey near the surface in dives that normally last only one or two minutes. Larger penguins can dive deep in case of need. Dives of the large Emperor Penguin have been recorded which reach a depth of 565 m (1870 ft) and last up to 22 minutes.', 'id': 960}

