{'passage': "On February 1, 1916, now settled in Grand Rapids, Dorothy King married Gerald Rudolff Ford, a salesman in a family-owned paint and varnish company, who later became president of the firm.     She began calling her son Gerald Rudolff Ford, Jr. The future president was never formally adopted, however, and he did not legally change his name until December 3, 1935; he also used a more conventional spelling of his middle name.     He was raised in Grand Rapids with his three half-brothers by his mother's second marriage: Thomas Gardner Ford (1918â\x80\x931995), Richard Addison Ford (born 1924), and James Francis Ford (1927â\x80\x932001). He also had three half-siblings by his father's second marriage: Marjorie King (1921â\x80\x931993), Leslie Henry King, Sr. (1923â\x80\x931976), and Patricia Jane King (born 1925).", 'id': 1998}

{'passage': "On March 29 1809, after being conquered by the armies of Alexander I of Russia in the Finnish War, Finland became an autonomous Grand Duchy in the Russian Empire until the end of 1917. During the Russian era, the Finnish language started to gain recognition, first probably to sever the cultural and emotional ties with Sweden and thereafter, from the 1860s onwards, as a result of a strong nationalism, known as the Fennoman movement. Milestones included the publication of what would become Finland's national epic, the Kalevala, in 1835; and the Finnish language achieving equal legal status with Swedish in 1892.", 'id': 1564}
---
{'passage': 'During World War II, Finland fought the Soviet Union twice: in the Winter War of 1939 40 after the Soviet Union had attacked Finland and in the Continuation War of 1941 44, following Operation Barbarossa in which Nazi Germany invaded the Soviet Union. Following German losses on the Eastern Front and the subsequent Soviet advance, Finland was forced to make peace with the Soviet Union.  This was followed by the Lapland War of 1944 45, when Finland forced the Germans out of northern Finland.', 'id': 1571}
---
{'passage': 'The Finnish Defence Forces are under the command of the Chief of Defence, who is directly subordinate to the President of the Republic in matters related to the military command. The current Chief of Defence is Admiral Juhani Kaskeala.', 'id': 1646}
---
{'passage': 'After the Second World War, neutral Finland lay in the grey zone between the Western countries and the Soviet Union. The "YYA Treaty" (Finno-Soviet Pact of Friendship, Cooperation, and Mutual Assistance) gave the Soviet Union some leverage in Finnish domestic politics. This was extensively exploited by President Urho Kekkonen against his opponents. He maintained an effective monopoly on Soviet relations, which gave him a status of "only choice for president". There was also a tendency of self-censorship regarding Finno-Soviet relations. This phenomenon was given the name "Finlandisation" by the German press (fi. suomettuminen). However, Finland maintained a democratic government and a market economy unlike most other countries bordering the Soviet Union.', 'id': 1574}
---
{'passage': "After a brief flirtation with monarchy, Finland became a presidential republic, with Kaarlo Juho StÃ¥hlberg elected as its first president in 1919. The Finnish Russian border was determined by the Treaty of Tartu in 1920, largely following the historic border but granting Pechenga (Finnish: Petsamo) and its Barents Sea harbour to Finland. Finnish democracy survived the upsurge of the extreme rightist Lapua Movement and Great Depression in the early '30s. However, legislators tended to be anti-communist and the relationship between Finland and the Soviet Union was tense.", 'id': 1569}

{'passage': "The gray wolf is a member of the genus Canis, which comprises between 7 and 10 species. It is one of six species termed 'wolf', the others being the Red Wolf (Canis rufus), the Indian Wolf (Canis indica), the Himalayan wolf (Canis himalayaensis), the Eastern Canadian Wolf (Canis lycaon) and the Ethiopian Wolf (Canis simensis).", 'id': 1093}
---
{'passage': 'At one point, up to 50 gray wolf subspecies were recognized. Though no true consensus has been reached, this list can be condensed to 13â\x80\x9315 general extant subspecies. Modern classifications take into account the DNA, anatomy, distribution, and migration of various wolf colonies.', 'id': 1097}
---
{'passage': 'The gray wolf (Canis lupus), also known as the timber wolf or, simply, wolf, is a mammal of the order Carnivora. The gray wolf is the largest member of the family Canidae and also the most well known of wolves. Its shoulder height ranges from 0.6 to 0.9 meters (26â\x80\x9336 inches) and its weight typically varies between 32 and 62 kilograms (70â\x80\x93135 pounds). As evidenced by studies of DNA sequencing and genetic drift the gray wolf shares a common ancestry with the domestic dog (Canis lupus familiaris).', 'id': 1021}
---
{'passage': 'With respect to common names, spelling differences result in the alternative spelling grey wolf. As the first-named and most widespread of species termed "wolf", gray wolves are often simply referred to as wolves. It was one of the many species originally described by Carolus Linnaeus in his eighteenth-century work, Systema Naturae, and it still bears its original classification, Canis lupus.      The binomial name is derived from the Latin Canis, meaning "dog", and lupus, "wolf".    ', 'id': 1094}
---
{'passage': 'Desert dwelling grey wolf subspecies, such as this Arabian wolf, tend to be smaller than their more northern cousins. Classifying gray wolf subspecies can be challenging. Although scientists have proposed a host of subspecies, wolf taxonomy at this level remains controversial.     Indeed, only a single wolf species may exist. Taxonomic modification will likely continue for years to come.', 'id': 1095}

{'passage': "On January 29 1819, Sir Thomas Stamford Raffles landed on the main island. Spotting its potential as a strategic geographical trading post in Southeast Asia, Raffles signed a treaty with Sultan Hussein Shah on behalf of the British East India Company to develop Singapore as a British trading post and settlement, marking the start of the island's modern era. Raffles's deputy, William Farquhar, oversaw a period of growth and ethnic migration, which was largely spurred by a no-restriction immigration policy. The British India office governed the island from 1858, but Singapore was made a British crown colony in 1867, answerable directly to the Crown. By 1869 the island boasted a sizeable community of 100,000.", 'id': 2709}
---
{'passage': 'Due to the lack of space, few historical buildings remain in the centre of the Central Business District (CBD) of Singapore - the Fullerton Hotel and the previously-moved Lau Pa Sat being some exceptions. However, just outside of Raffles Place, and throughout the rest of the downtown core, there is a large scattering of pre-WWII buildings - some going back nearly as far as Raffles, as with the Empress Place Building, built in 1827. Many classical buildings were destroyed during the post-war decades, up until the 1990s, when the government started strict programs to conserve the buildings and areas of historic value.', 'id': 2797}
---
{'passage': 'The south of Singapore, around the mouth of the Singapore River and what is now the Downtown Core, used to be the only concentrated urban area, while the rest of the land was either undeveloped tropical rainforest or used for agriculture. Since the 1960s, the government has constructed new residential towns in outlying areas, resulting in an entirely built-up urban landscape. The Urban Redevelopment Authority was established on 1 April 1974, responsible for urban planning.', 'id': 2730}
---
{'passage': "The first records of settlement in Singapore are from the second century AD.    The island was an outpost of the Sumatran Srivijaya empire and originally bore the Javanese name Temasek ('sea town'). Temasek (Tumasek) rapidly became a significant trading settlement, but declined in the late 14th century. There are few remnants of old Temasek in Singapore, but archaeologists in Singapore have uncovered artefacts of that and other settlements. Between the 16th and early 19th centuries, Singapore island was part of the Sultanate of Johor. During the Malay-Portugal wars in 1613, the settlement was set ablaze by Portuguese troops.    The Portuguese subsequently held control in that century and the Dutch in the 17th, but throughout most of this time the island's population consisted mainly of fishermen.", 'id': 2708}
---
{'passage': 'During World War II, the Imperial Japanese Army invaded Malaya, culminating in the Battle of Singapore. The ill-prepared British were defeated in six days, and surrendered the supposedly impregnable "Bastion of the Empire" to General Tomoyuki Yamashita on 15 February 1942 in what is now known as the British Empire\'s greatest military defeat. The Japanese renamed Singapore  , from Japanese  , or "southern island obtained in the age of ShÅ\x8dwa", and occupied it until the British repossessed the island on September 12 1945, a month after the Japanese surrender.', 'id': 2712}

