{'passage': "John Adams was the oldest of three brothers, born on October 30, 1735 (October 19, 1735 by the Old Style, Julian calendar), in Braintree, Massachusetts, though in an area which became part of Quincy, Massachusetts in 1792. His birthplace is now part of Adams National Historical Park. His father, a farmer and a Deacon, also named John (1690-1761), was a fourth-generation descendant of Henry Adams, who immigrated from Barton St David, Somerset, England, to Massachusetts Bay Colony in about 1636, from a Welsh male line called Ap Adam.  /ref> His mother was Susanna Boylston Adams. Ferling (1992) ch 1  Who is a descendant of the Boylstons of Brookline, one of the colony's most vigorous and successful families.", 'id': 638}
---
{'passage': "Grant signed a bill into law that created Yellowstone National Park (America's first National Park) on March 1, 1872.  General Grant National Memorial by the National Park Service. Retrieved March 29, 2006.  Grant also signed into law making Christmas a federal holiday in 1870.  Federal Holidays: Evolution and Application, CRS Report for Congress, 98-301 GOV, updated February 8, 1999, by Stephen W. Stathis", 'id': 1816}
---
{'passage': 'Adams, a sponsor of the American Revolution in Massachusetts, was a driving force for independence in 1776; Jefferson called him the "Colossus of Independence". He represented the Continental Congress in Europe. He was a major negotiator of the eventual peace treaty with Great Britain, and chiefly responsible for obtaining the loans from the Amsterdam money market necessary for the conduct of the Revolution. His prestige secured his two elections as Washington\'s Vice President and his election to succeed him.   As President, he was frustrated by battles inside his own Federalist party against a faction led by Alexander Hamilton, but he broke with them to avert a major conflict with France in 1798, during the Quasi-War crisis. He became the founder of an important family of politicians, diplomats and historians, and in recent years his reputation has improved.', 'id': 636}
---
{'passage': "Lincoln's birthplace and family home are national historic memorials: the Abraham Lincoln Birthplace National Historic Site in Hodgenville, and the Lincoln Home National Historic Site in Springfield, Illinois. The Abraham Lincoln Presidential Library and Museum opened in Springfield in 2005; it is a major tourist attraction, with state-of-the-art exhibits. The Abraham Lincoln National Cemetery is located in Elwood, Illinois.", 'id': 389}

{'passage': "The largest living species is the Emperor Penguin (Aptenodytes forsteri): adults average about 1.1 m (3 ft 7 in) tall and weigh 35 kg (75 lb) or more. The smallest penguin species is the Little Blue Penguin (also known as the Fairy Penguin), which stands around 40 cm tall (16 in) and weighs 1 kg (2.2 lb). Among extant penguins larger penguins inhabit colder regions, while smaller penguins are generally found in temperate or even tropical climates (see also Bergmann's Rule). Some prehistoric species attained enormous sizes, becoming as tall or as heavy as an adult human (see below for more). These were not restricted to Antarctic regions; on the contrary, subantarctic regions harboured high diversity, and at least one giant penguin occurred in a region not quite 2000 km south of the Equator 35 mya , in a climate decidedy warmer than today.", 'id': 953}
---
{'passage': 'The number of penguin species is debated. Depending on which authority is followed, penguin biodiversity varies between 17 and 20 living species, all in the subfamily Spheniscinae. Some sources consider the White-flippered Penguin a separate Eudyptula species, while others treat it as a subspecies of the Little Penguin (e.g. Williams, 1995; Davis & Renner, 2003); the actual situation seems to be more complicated (Banks et al. 2002). Similarly,  it is still unclear whether the Royal Penguin is merely a color morph of the Macaroni penguin. Also eligible to be a separate species is the Northern population of Rockhopper penguins (Davis & Renner, 2003). Although all penguin species are native to the southern hemisphere, they are not, contrary to popular belief, found only in cold climates, such as Antarctica. In fact, only a few species of penguin actually live so far south. At least ten  species live in the temperate zone; one lives as far north as the GalÃ¡pagos Islands: the GalÃ¡pagos Penguin.', 'id': 952}
---
{'passage': "During the Late Eocene and the Early Oligocene (40-30 mya), some lineages of gigantic penguins existed. Nordenskjoeld's Giant Penguin was the tallest, growing nearly 1.80 meters (6 ft) tall. The New Zealand Giant Penguin was probably the heaviest, weighing 80 kg or more. Both were found on New Zealand, the former also in the Antarctic farther eastwards.", 'id': 979}
---
{'passage': 'The genus Aptenodytes appears to be the basalmost divergence among living penguins; they have bright yellow-orange neck, breast, and bill patches, incubate by placing their eggs on their feet, and when they hatch, they are almost naked. This genus has a distribution centered  on the Antarctic coasts and barely extends to some subantarctic islands today.', 'id': 984}
---
{'passage': 'But size plasticity seems to have been great at this initial stage of penguin radiation: on Seymour Island, Antarctica, for example, around ten known species of penguins ranging from medium to huge size apparently coexisted some 35 mya during the Priabonian (Late Eocene) (Jadwiszczak 2006). It is not even known whether the gigantic palaeeudyptines constitute a monophyletic lineage, or whether gigantism was evolved independently in a much restricted Palaeeudyptinae and the Anthropornithinae - were they considered valid -, or whether there was a wide size range present in the Palaeeudyptinae as delimited as usually done these days (i.e., including Anthropornis nordenskjoeldi) (Ksepka et al. 2006).  The oldest well-described giant penguin, the 5-foot-tall Icadyptes salasi, actually occurred as far north as northern Peru about 36 mya.', 'id': 981}

{'passage': 'Diving penguins reach 6 to 12 km/h (3.7 to 7.5 mph), though there are reports of velocities of 27 km/h (17 mph) (which are more realistic in the case of startled flight). The small penguins do not usually dive deep; they catch their prey near the surface in dives that normally last only one or two minutes. Larger penguins can dive deep in case of need. Dives of the large Emperor Penguin have been recorded which reach a depth of 565 m (1870 ft) and last up to 22 minutes.', 'id': 960}
---
{'passage': 'Some penguins mate for life, others for just one season. They generally raise a small brood, and the parents cooperate in caring for the clutch and the young. During the cold season on the other hand the mates separate for several months to protect the egg. Usually, the male stays with the egg and keeps it warm while the female goes to sea to find food for the baby. When the female comes back, they switch roles.', 'id': 965}
---
{'passage': 'Most penguins feed on krill, fish, squid, and other forms of sealife caught while swimming underwater. They spend half of their life on land and half in the oceans.', 'id': 954}
---
{'passage': 'Penguins have an average sense of hearing for birds (Wever et al 1969); this is used by parents and chicks to locate one another in crowded colonies (Jouventin et al 1999). Their eyes are adapted for underwater vision, and are their primary means of locating prey and avoiding predators; in air it has been suggested that they are nearsighted, although research has not supported this hypothesis (Sivak et al 1987).', 'id': 962}
---
{'passage': 'Penguins have a thick layer of insulating feathers which are designed to keep them warm in water (heat loss in water is much greater than in air).  The Emperor penguin (the largest penguin) has the largest body mass of all penguins, which further reduces relative surface area and heat loss. They also are able to control blood flow to their extremities, reducing the amount of blood which gets cold, but still keeping the extremities from freezing.  In the extreme cold of the Antarctic winter, the females are at sea fishing for food leaving the males to brave the weather by themselves.  They often huddle together to keep warm and rotate positions to make sure that each penguin gets a turn in the center of the heat pack.', 'id': 963}

{'passage': 'During World War II, the Imperial Japanese Army invaded Malaya, culminating in the Battle of Singapore. The ill-prepared British were defeated in six days, and surrendered the supposedly impregnable "Bastion of the Empire" to General Tomoyuki Yamashita on 15 February 1942 in what is now known as the British Empire\'s greatest military defeat. The Japanese renamed Singapore  , from Japanese  , or "southern island obtained in the age of ShÅ\x8dwa", and occupied it until the British repossessed the island on September 12 1945, a month after the Japanese surrender.', 'id': 2712}
---
{'passage': 'The British East India Company established a trading post on the island in 1819. The main settlement up to that point was a Malay fishing village at the mouth of the Singapore River. Several hundred indigenous Orang Laut people also lived around the coast, rivers and smaller islands. The British used Singapore as a strategic trading post along the spice route.    It became one of the most important commercial and military centres of the British Empire. Winston Churchill called it "Britain\'s greatest defeat" when it was occupied by the Japanese during World War II.    Singapore reverted to British rule in 1945. In 1963, it merged with Malaya, Sabah and Sarawak to form Malaysia. Less than two years later it split from the federation and became an independent republic on 9 August 1965. Singapore was admitted to the United Nations on September 21 that same year.', 'id': 2701}
---
{'passage': 'The armed forces serve primarily as a deterrent against potential aggressors and also provide humanitarian assistance to other countries. Singapore has mutual defence pacts with several countries, most notably the Five Power Defence Arrangements. There is an extensive overseas network of training grounds in the United States, Australia, New Zealand, France, Taiwan, Thailand, Brunei, India and South Africa. Since 1980, the concept and strategy of "Total Defence" has been adopted in all aspects of security; an approach aimed at strengthening Singapore against all kinds of threats.', 'id': 2755}
---
{'passage': "Singapore's defence resources have been used in international humanitarian aid missions, including United Nations peacekeeping assignments involved in 11 different countries.    In September 2005, the Republic of Singapore Air Force (RSAF) sent three CH-47 Chinook helicopters to Louisiana to assist in relief operations for Hurricane Katrina. In the aftermath of the 2004 Asian Tsunami (or Boxing Day Tsunami}, the SAF deployed 3 tank landing ships, 12 Super Puma and 8 Chinook helicopters to aid in relief operations to the countries that were affected by the tsunami.", 'id': 2757}
---
{'passage': "Singapore became a self-governing state in 1959 with Yusof bin Ishak its first Yang di-Pertuan Negara and Lee Kuan Yew its first Prime Minister. Following the 1962 Merger Referendum of Singapore, Singapore joined Malaya, along with Sabah and Sarawak, to form the Federation of Malaysia on September 16 1963, but separated from it two years later after heated ideological conflict between the state's PAP government and the federal Kuala Lumpur government. Singapore officially gained sovereignty on 9 August 1965.    Yusof bin Ishak was sworn in as the first President of Singapore and Lee Kuan Yew remained prime minister.", 'id': 2714}

{'passage': 'Indonesia is a republic with a presidential system. As a unitary state, power is concentrated in the national government. Following the resignation of President Suharto in 1998, Indonesian political and governmental structures have undergone major reforms. Four amendments to the 1945 Constitution of Indonesia In 1999, 2000, 2001 and 2002  have revamped the executive, judicial, and legislative branches.    The president of Indonesia is the head of state, commander-in-chief of the Indonesian Armed Forces, and the director of domestic governance, policy-making, and foreign affairs. The president appoints a council of ministers, who are not required to be elected members of the legislature. The 2004 presidential election was the first in which the people directly elected the president and vice president.    The president serves a maximum of two consecutive five-year terms. _ (2002), The fourth Amendment of 1945 Indonesia Constitution, Chapter III â\x80\x93 The Executive Power, Art. 7.', 'id': 774}
---
{'passage': "Aceh, Jakarta, Yogyakarta, Papua, and West Papua provinces have greater legislative privileges and a higher degree of autonomy from the central government than the other provinces. The Acehnese government, for example, has the right to create an independent legal system; in 2003, it instituted a form of Sharia (Islamic law).    Yogyakarta was granted the status of Special Region in recognition of its pivotal role in supporting Indonesian Republicans during the Indonesian Revolution. The positions of governor and its vice governor are prioritized for descendants of the Sultan of Yogyakarta and Paku Alam, respectively, much like a sultanate. (Elucidation on the Indonesia Law No. 22/1999 Regarding Regional Governance. People's Representative Council (1999). Chapter XIV Other Provisions, Art. 122;   (translated version). The President of Republic of Indonesia (1974). Chapter VII Transitional Provisions, Art. 91  Papua, formerly known as Irian Jaya, was granted special autonomy status in 2001. As part of the autonomy package was the introduction of the Papuan People's Council tasked with arbitration and speaking on behalf of Papuan tribal customs, however, the implementation of the autonomy measures has been criticized as half-hearted and incomplete.  ;    Jakarta is the country's special capital region.", 'id': 784}
---
{'passage': "The Republic of Indonesia ( ) ( ), is a nation in Southeast Asia. Comprising 17,508 islands, it is the world's largest archipelagic state. With a population of over 234 million people, it is the world's fourth most populous country and the most populous Muslim-majority nation, although officially it is not an Islamic state. Indonesia is a republic, with an elected parliament and president. The nation's capital city is Jakarta. The country shares land borders with Papua New Guinea, East Timor and Malaysia. Other neighboring countries include Singapore, the Philippines, Australia, and the Indian territory of the Andaman and Nicobar Islands.", 'id': 751}
---
{'passage': "Administratively, Indonesia consists of 33 provinces, five of which have special status. Each province has its own political legislature and governor. The provinces are subdivided into regencies (kabupaten) and (kota), which are further subdivided into subdistricts (kecamatan), and again into village groupings (either desa or kelurahan). Following the implementation of regional autonomy measures in 2001, the regencies and cities have become the key administrative units, responsible for providing most government services. The village administration level is the most influential on a citizen's daily life, and handles matters of a village or neighborhood through an elected lurah or kepala desa (village chief).", 'id': 783}
---
{'passage': 'Sukarno moved from democracy towards authoritarianism, and maintained his power base by balancing the opposing forces of the Military, Islam, and the Communist Party of Indonesia (PKI). Ricklefs (1991), pages 237 - 280  An attempted coup on September 30 1965 was countered by the army, who led a  violent anti-communist purge, during which the PKI was blamed for the coup and effectively destroyed. Friend (2003), pages 107â\x80\x93109;  ; Ricklefs (1991), pages 280â\x80\x93283, 284, 287â\x80\x93290  Between 500,000 and one million people were killed.  ;    The head of the military, General Suharto, out-maneuvered the politically weakened Sukarno, and was formally appointed president in March 1968. His New Order administration    was supported by the US government, US National Archives, RG 59 Records of Department of State; cable no. 868, ref: Embtel 852, Oct 5 1965. ; Adrian Vickers, A History of Modern Indonesia. Cambridge University Press, p. 163; 2005; David Slater, Geopolitics and the Post-Colonial: Rethinking North-South Relations, London: Blackwell, p. 70  and encouraged foreign investment in Indonesia, which was a major factor in the subsequent three decades of substantial economic growth  ;  ;', 'id': 769}

{'passage': "Another issue that presented itself during Fillmore's presidency was the arrival of Louis Kossuth (exiled leader of a failed Hungarian revolution). Kossuth wanted the United States to abandon its non-intervention policies when it came to European affairs and recognize Hungaryâ\x80\x99s independence. The problem came with the enormous support Kossuth received from German-American immigrants to the United States (who were essential in the re-election of both Whigs and Democrats). Fillmore refused to change American policy, and decided to remain neutral despite the political implications that neutrality would produce.", 'id': 174}
---
{'passage': "Fillmore's greatest difficulty with the fugitive slave law was how to enforce it without seeming to show favor towards Southern Whigs. His solution was to appease both northern and southern Whigs by calling for the enforcement of the fugitive slave law in the North, and enforcing in the South a law forbidding involvement in Cuba (for the sole purpose of adding it as a slave state).", 'id': 173}
---
{'passage': 'As president, Fillmore dealt with increasing party divisions within the Whig party; party harmony became one of his primary objectives. He tried to unite the party by pointing out the differences between the Whigs and the Democrats (by proposing tariff reforms that negatively reflected on the Democratic Party). Another primary objective of Fillmore was to preserve the Union from the intensifying slavery debate.', 'id': 162}
---
{'passage': 'At the Whig national convention in 1848, the nomination of Gen. Zachary Taylor for president angered the supporters of Henry Clay as well as the opponents of slavery extension into the territory gained by the U.S.-Mexican War. A group of practical Whig politicians nominated Fillmore for vice president, believing that he would heal party wounds and help the ticket carry New York state.', 'id': 156}
---
{'passage': 'Throughout the Civil War, Fillmore opposed President Lincoln and during Reconstruction supported President Johnson. He commanded the Union Continentals, a corps of home guards of males over the age of 45 from the Upstate New York area, during the Civil War.', 'id': 186}

