{'passage': 'His biggest success was passage of the Hepburn Act of 1906, the provisions of which were to be regulated by the Interstate Commerce Commission (ICC). The most important provision of the Act gave the ICC the power to replace existing rates with "just-and-reasonable" maximum rates, with the ICC to define what was just and reasonable. Anti-rebate provisions were toughened, free passes were outlawed, and the penalties for violation were increased. Finally, the ICC gained the power to prescribe a uniform system of accounting, require standardized reports, and inspect railroad accounts. The Act made ICC orders binding; that is, the railroads had to either obey or contest the ICC orders in federal court. To speed the process, appeals from the district courts would go directly to the U.S. Supreme Court.', 'id': 2929}
