{'passage': "More than 100 languages and dialects are spoken in Ghana. English is the country's official language and predominates government and business affairs. It is also the standard language used for educational instruction. Native Ghanaian languages are divided into two linguistic subfamilies of the Niger-Congo language family. Languages belonging to the Kwa subfamily are found predominantly to the south of the Volta River, while those belonging to the Gur subfamily are found predominantly to the north. The Kwa group, which is spoken by about 75% of the country's population, includes the Akan, Ga-Dangme, and Ewe languages. The Gur group includes the Gurma, Grusi, and Dagbani languages.", 'id': 1362}
---
{'passage': "Nine languages have the status of government-sponsored languages: Akan, Dagaare/Wale, Dagbani, Dangme, Ewe, Ga, Gonja, Kasem, and Nzema. Though not an official language, Hausa is the lingua-franca spoken among Ghana's Muslims, who comprise about 14% of the population.", 'id': 1363}
---
{'passage': "The first contact between the Ghanaian peoples, the Fantes on the coastal area and Europeans occurred in 1482. The Portuguese  first landed at Elmina, a coastal city inhabited by the Fanti nation-state in 1482. During the next few centuries parts of the area were controlled by British, Portuguese, and Scandinavian powers, with the British ultimately prevailing. These nation-states maintained varying alliances with the colonial powers and each other, which resulted in the 1806 Ashanti-Fante War, as well as an ongoing struggle by the Empire of Ashanti against the British. Moves toward regional de-colonization began in 1946, and the area's first constitution was promulgated in 1951.", 'id': 1346}
---
{'passage': 'Religions: Christian 63%, African beliefs 21%, Muslim 16%,  Facts on People of Ghana, accessed July 13, 2006', 'id': 1361}
