{'passage': "The Nile River at the ancient city of Aswan, a popular destination for vacationersEgypt's economy depends mainly on agriculture, media, petroleum exports, and tourism; there are also more than three million Egyptians working abroad, mainly in Saudi Arabia, the Persian Gulf and Europe. The completion of the Aswan High Dam in 1971 and the resultant Lake Nasser have altered the time-honored place of the Nile River in the agriculture and ecology of Egypt. A rapidly-growing population, limited arable land, and dependence on the Nile all continue to overtax resources and stress the economy.", 'id': 899}
