{'passage': 'Egypt is the most populated country in the Middle East and the second-most populous on the African continent, with an estimated 78 million people. Almost all the population is concentrated along the banks of the Nile (notably Cairo and Alexandria), in the Delta and near the Suez Canal. Approximately 80-90% of the population adheres to Islam and most of the remainder to Christianity, primarily the Coptic Orthodox denomination.    Apart from religious affiliation, Egyptians can be divided demographically into those who live in the major urban centers and the fellahin or farmers of rural villages. The last 40 years have seen a rapid increase in population due to medical advances and massive increase in agricultural productivity,  BBC NEWS | The limits of a Green Revolution?  made by the Green Revolution.  Food First/Institute for Food and Development Policy', 'id': 907}
